import { HeroesModule } from './heroes/heroes.module';
import { DbzComponent } from './dbz/dbz.component';

@NgModule({
  declarations: [
    AppComponent,
    DbzComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    CounterModule,
    HeroesModule
  ],
  providers: [],
  bootstrap: [AppComponent]
